import SearchBar from '../SearchBar/SearchBar.jsx';

export default function Nav({ onSearch }) {
  return (
    <div>
        <SearchBar onSearch={onSearch}/>
        <button>
          <i className='fab fa-free-code-camp'></i>
        </button>
    </div>
  )
}
